package com.ufgov.zc.client.zc.flowconsole.parts;public class Link {  private int x;  private int y;  private String direction;  private String diretionUrl;  private double rotation;  public int getX() {    return x;  }  public void setX(int x) {    this.x = x;  }  public int getY() {    return y;  }  public void setY(int y) {    this.y = y;  }  public String getDirection() {    return direction;  }  public void setDirection(String direction) {    this.direction = direction;  }  public double getRotation() {    return rotation;  }  public void setRotation(double rotation) {    this.rotation = rotation;  }  public String getDiretionUrl() {    return diretionUrl;  }  public void setDiretionUrl(String diretionUrl) {    this.diretionUrl = diretionUrl;  }}